import React, { Component } from 'react'
import Search from './Search'
import Result from './Result'

export class Weather extends Component {
  constructor(){
    super()

    this.state = {
      city :"",
      lat:"",
      lon:"",
      weatherData :null
    }
  }
  onChangeHandler = (e) =>{
    console.log(e.target.name);
  }
 
  render() {
    return (
      <div> 
        <Search city={this.state.city} lat={this.state.lat} lon={this.state.lon} change={this.onChangeHandler}></Search>
        <Result></Result>
      </div>
    )
  }
}

export default Weather
